import React, {Component} from 'react'
import {SidebarData} from "./SidebarData"

function Sidebar(){

    return(
        <div className='Sidebar'>

        
            <div className="SidebarList">
            <ul>
                {SidebarData.map((val, key) => {
                    return(
                        <li key={key}>
                            {" "}
                            <div>{val.icon}</div>{" "}
                            <div>
                                {val.title}
                            </div>    
                        </li>
                    )
                })}
            </ul>

            </div>
        </div>
    )

}

export default Sidebar
